import {Injectable} from '@angular/core';
import {HttpClient, HttpResponse} from '@angular/common/http';
import {Observable} from 'rxjs';

// import { SERVER_API_URL } from 'app/app.constants';
import {ApplicationConfigService} from 'app/core/config/application-config.service';
import {ICompanyHistory} from './amendment-history.model';
import {Ns2HttpService} from 'app/shared/service/ns2-http.service';

export type EntityResponseType = HttpResponse<ICompanyHistory>;
export type EntityArrayResponseType = HttpResponse<ICompanyHistory[]>;

@Injectable({ providedIn: 'root' })
export class CompanyHistoryService {
  public resourceUrl = this.applicationConfigService.getEndpointFor('api/company/amendment-history');

  constructor(protected http: HttpClient,
    private applicationConfigService: ApplicationConfigService,
    private ns2Http: Ns2HttpService) {}

  getAll(options?: any): Observable<any> {
    return this.ns2Http.get(this.resourceUrl, options);
    // return this.http.get<ICompanyHistory[]>(this.resourceUrl, { params: params, observe: 'response' });
  }


  getByCompanyHistoryId(companyHistoryId: string): Observable<EntityResponseType> {
    return this.http.get<ICompanyHistory>(`${this.resourceUrl}/${companyHistoryId}`, { observe: 'response' });
  }
}
